col":[],"profile":[]},{"sql":"INSERT INTO `e5oha_fields_values`\r\n(`field_id`,`item_id`,`value`) VALUES \r\n('2','7','Das SRH Berufsbildungswerk Neckargem\u00fcnd bietet jungen Menschen mit speziellem F\u00f6rderbedarf eine kompetenzorientierte Berufsausbildung in \u00fcber 40 verschiedenen Berufen. Auf dem Weg zu ihrem Bildungsziel werden die aktuell \u00fcber 900 Auszubildenden dabei von einem interdisziplin\u00e4ren Expertenteam unterst\u00fctzt und zu einem professionellen Umgang mit ihren pers\u00f6nlichen Herausforderungen bef\u00e4higt.\\r\\n\\r\\nDiese einzigartige Kombination aus individueller F\u00f6rderung und kompetenzorientierter Berufsausbildung bereitet sie dabei optimal auf die Anforderungen der Gesellschaft und des k\u00fcnftigen Arbeitsmarkts vor.\\r\\n \\r\\n\\r\\nUnser Profil\\r\\n\\r\\nWir setzen auf gesundes Wachstum mit langfristiger Perspektive\\r\\nWir besch\u00e4ftigen ca. 750 Mitarbeitende\\r\\nca. 900 Teilnehmende befinden sich aktuell in der Berufsausbildung\\r\\nWir bilden in \u00fcber 40 Berufen aus\\r\\nDer SRH Campus Neckargem\u00fcnd umfasst rund 100.000 qm und ist komplett barrierefrei\\r\\nUnser TechnologieCampus steht f\u00fcr modernste Ausbildung in den Bereichen IT und Elektrotechnik\\r\\nWeitere Standorte befinden sich in Heidelberg und der Metropolregion Rhein-Neckar \\r\\nIn unseren Internaten wohnen 200 Teilnehmende, zus\u00e4tzlich haben wir \u00fcber 120 Au\u00dfenwohngruppen\\r\\nUnsere Teilnehmende erhalten therapeutische und medizinische Betreuung vor Ort')","params":[],"duration_str":"44.99ms","memory_str":"0B","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\libraries\\vendor\\joomla\\database\\src\\Mysqli\\MysqliDriver.php:776","callstack":[],"explain":[],"explain_col":[],"profile":[]},{"sql":"SELECT *\r\nFROM e5oha_fields\r\nWHERE `id` = '3'","params":[],"duration_str":"31.82ms","memory_str":"4.06KB","caller":"D:\\Kevin Zeugs\\Studium\\CMS\\cms\\libraries\\src\\Table\\Table.php:807","callstack":[],"explain":[],"expla